import React from "react";
import "./Skill.css";
import Web from "../../img/web.png";
import Arch from "../../img/arch.png";
import Design from "../../img/design.png";

const Skill = () => {
  return (
    <div className="skill">
      <div className="technical">
        <span>My Technical</span>
        <span>Skills</span>
        <span>
          Web Application Development, Mobile Application Development,
          Computational Design, Architectural Design, UI/UX Design
          <br />
          Database Management: MySQL, PostgreSQL, MongoDB
          <br />
          Developer Tools: AWS, Git, IntelliJ, Eclipse, VS Code, XCode, Android
          Studio
          <br />
          Frameworks: Express, React, Node, Spring Boot, Bootstrap
        </span>
        <button className="button s-button">Download CV</button>
        <div className="blur s-blur1" style={{ background: "#ABF1FF94" }}></div>
      </div>
      <div className="cards">
        <Card
          emoji={Web}
          heading={"Developer"}
          detail={"Java, Python, "}
          // Architecture = {Arch}
          // Design = {Design}
        />
      </div>
    </div>
  );
};

export default Skill;
